import React from 'react';
import {Link, NavLink} from "react-router-dom";

const Navbar = () => {

    return (
        <div className="navBar">
            <div className="cvaNavLogo">
                <Link to="/" id="ket">CVA Ketenzorg</Link>
            </div>

            <div className="cvaNavButtons">
                <NavLink to="/Begeleiding" id="beg">Begeleiding</NavLink>
                <NavLink to="/Professionals" id="pro">Professionals</NavLink>
                <NavLink to="/Informatie" id="info">Informatie</NavLink>
                <NavLink to="/Contact" id="cont">Contact</NavLink>
            </div>
        </div>
    )
}

export default Navbar;
